local textures = {
    rune_earth = "",
    rune_electric = "",
    rune_fire = "",
    rune_ice = "",
    rune_telepathic = "",
    rune_void = "",
    rune_water = "",
    rune_wind = "",
    rune_poison = "",
    rune_healing = "",
    rune_shield = "",
    rune_summoning = "",
    rune_resize = "",
    rune_disguise = "",
}
for k, v in pairs(textures) do
    textures[k] = "blank.png^[png:" .. textures[k]
    minetest.register_craftitem(":magikacia:zzz_textures_" .. k, {
        description = k,
        inventory_image = textures[k],
    })
end
table.update(magikacia.textures, textures)